#define ESC_MIN -1
#define ESC_MAX 1000000000

#define GRASS 0
#define FIRE 1
#define WALL 2
#define USER 3
#define ESC_DOOR 4

int escape_fire_loop(int** grid_root, int row_size, int col_size, int** fire_grid) {
    int dx[4] = { 1, -1, 0, 0 };
    int dy[4] = { 0, 0, 1, -1 };
    int **grid = (int **) malloc(sizeof(int *) * row_size);
    for (int i = 0; i < row_size; i++) {
        grid[i] = (int *) malloc(sizeof(int) * col_size);
        memcpy(grid[i], grid_root[i], sizeof(int) * col_size);
        memset(fire_grid[i], 0, sizeof(int) * col_size);
        for (int j = 0; j < col_size; j++) {
            fire_grid[i][j] = ESC_MAX;
        }
    }

    int **fire_queue = (int **) malloc(sizeof(int *) * (row_size * col_size));
    for (int i = 0; i < (row_size * col_size); i++) {
        fire_queue[i] = (int *) malloc(sizeof(int) * 2);
    }

    int fire_queue_index = 0;

    for (int i = 0; i < row_size; i++) {
        for (int j = 0; j < col_size; j++) {
            if (grid[i][j] == FIRE) {
                fire_queue[fire_queue_index][0] = i;
                fire_queue[fire_queue_index][1] = j;
                fire_grid[i][j] = 0;
                fire_queue_index++;
            }
        }
    }

    int offset_fire_queue_index = 0;
    while (fire_queue_index != 0) {
        int update_fire_queue_index = fire_queue_index;
        for (int i = offset_fire_queue_index; i < fire_queue_index; i++) {
            for (int j = 0; j < 4; j++) {
                int x = fire_queue[i][0] + dx[j];
                int y = fire_queue[i][1] + dy[j];
                if (
                    x >= row_size || x < 0 || y >= col_size || y < 0 ||
                    grid[x][y] == FIRE
                ) {
                    continue;
                } else if (grid[x][y] == WALL) {
                    fire_grid[x][y] = ESC_MAX;
                    continue;
                } else if (grid[x][y] == ESC_DOOR) {
                    fire_grid[x][y] = fire_grid[fire_queue[i][0]][fire_queue[i][1]] + 1;
                    goto stop_simulate;
                }
                grid[x][y] = FIRE;
                fire_queue[update_fire_queue_index][0] = x;
                fire_queue[update_fire_queue_index][1] = y;
                fire_grid[x][y] = fire_grid[fire_queue[i][0]][fire_queue[i][1]] + 1;
                update_fire_queue_index++;
            }
            offset_fire_queue_index++;
        }
        if (update_fire_queue_index == fire_queue_index) {
            break;
        }
        fire_queue_index = update_fire_queue_index;
    }

    stop_simulate:
        for (int i = 0; i < row_size; i++) {
            free(grid[i]);
        }
        for (int i = 0; i < (row_size * col_size); i++) {
            free(fire_queue[i]);
        }
        free(fire_queue);
        free(grid);


    return 0;
}


int escape_user_loop(int** grid_root, int row_size, int col_size, int** user_grid) {
    int dx[4] = { 1, -1, 0, 0 };
    int dy[4] = { 0, 0, 1, -1 };
    int **grid = (int **) malloc(sizeof(int *) * row_size);
    for (int i = 0; i < row_size; i++) {
        grid[i] = (int *) malloc(sizeof(int) * col_size);
        memcpy(grid[i], grid_root[i], sizeof(int) * col_size);
        memset(user_grid[i], 0, sizeof(int) * col_size);
    }

    int **user_queue = (int **) malloc(sizeof(int *) * (row_size * col_size));
    for (int i = 0; i < (row_size * col_size); i++) {
        user_queue[i] = (int *) malloc(sizeof(int) * 2);
    }

    int user_queue_index = 0;

    for (int i = 0; i < row_size; i++) {
        for (int j = 0; j < col_size; j++) {
            if (grid[i][j] == USER) {
                user_queue[user_queue_index][0] = i;
                user_queue[user_queue_index][1] = j;
                user_queue_index++;
                break;
            }
        }
    }

    int offset_user_queue_index = 0;
    while (user_queue_index != 0) {
        int update_user_queue_index = user_queue_index;
        for (int i = offset_user_queue_index; i < user_queue_index; i++) {
            for (int j = 0; j < 4; j++) {
                int x = user_queue[i][0] + dx[j];
                int y = user_queue[i][1] + dy[j];
                if (
                    x >= row_size || x < 0 || y >= col_size || y < 0 ||
                    grid[x][y] == FIRE || grid[x][y] == USER
                ) {
                    continue;
                } else if (grid[x][y] == WALL) {
                    user_grid[x][y] = ESC_MAX;
                    continue;
                } else if (grid[x][y] == ESC_DOOR) {
                    user_grid[x][y] = user_grid[user_queue[i][0]][user_queue[i][1]] + 1;
                    goto stop_simulate;
                }
                grid[x][y] = USER;
                user_queue[update_user_queue_index][0] = x;
                user_queue[update_user_queue_index][1] = y;
                user_grid[x][y] = user_grid[user_queue[i][0]][user_queue[i][1]] + 1;
                update_user_queue_index++;
            }
            offset_user_queue_index++;
        }
        if (update_user_queue_index == user_queue_index) {
            break;
        }
        user_queue_index = update_user_queue_index;
    }

    stop_simulate:
        for (int i = 0; i < row_size; i++) {
            free(grid[i]);
        }
        for (int i = 0; i < (row_size * col_size); i++) {
            free(user_queue[i]);
        }
        free(user_queue);
        free(grid);

    return 0;

}

int can_escape(int** grid, int row_size, int col_size, int delay_time, int** fire_grid, int** user_grid, int** user_queue) {
    int dx[4] = { 1, -1, 0, 0 };
    int dy[4] = { 0, 0, 1, -1 };
    
    int user_queue_index = 0;
    user_queue[user_queue_index][0] = 0;
    user_queue[user_queue_index][1] = 0;
    user_queue_index = 1;
    int answer = ESC_MIN;

    int offset_user_queue_index = 0;
    while (user_queue_index - offset_user_queue_index > 0) {
        int update_user_queue_index = user_queue_index;
        for (int i = offset_user_queue_index; i < user_queue_index; i++) {
            for (int j = 0; j < 4; j++) {
                int x = user_queue[i][0] + dx[j];
                int y = user_queue[i][1] + dy[j];
                if (
                    x >= row_size || x < 0 || y >= col_size || y < 0 ||
                    grid[x][y] == WALL || grid[x][y] == FIRE || grid[x][y] == USER
                ) {
                    continue;
                } else if (grid[x][y] == ESC_DOOR) {
                    if (user_grid[x][y] + delay_time <= fire_grid[x][y]) {
                        answer = user_grid[x][y];
                    } else {
                        answer = ESC_MIN;
                    }
                    goto release_resource;
                } else if (user_grid[x][y] + delay_time >= fire_grid[x][y]) {
                    continue;
                }

                grid[x][y] = USER;
                user_queue[update_user_queue_index][0] = x;
                user_queue[update_user_queue_index][1] = y;
                update_user_queue_index++;

                
            }
            offset_user_queue_index++;
        }
        user_queue_index = update_user_queue_index;
    }

    release_resource:

    return answer;

}

int maximumMinutes(int** grid, int gridSize, int* gridColSize) {
    if (gridSize > 0 && gridColSize[gridSize-1] > 0 && grid[0][0] == FIRE) {
        return -1;
    }
    
    int row_size = gridSize;
    int col_size = gridColSize[gridSize-1];
    grid[0][0] = USER;
    grid[row_size-1][col_size-1] = ESC_DOOR;


    int **fire_grid = (int **) malloc(sizeof(int *) * row_size);
    int **user_grid = (int **) malloc(sizeof(int *) * row_size);
    for (int i = 0; i < row_size; i++) {
        fire_grid[i] = (int *) malloc(sizeof(int) * col_size);
        user_grid[i] = (int *) malloc(sizeof(int) * col_size);
        memset(fire_grid[i], 0, sizeof(int) * col_size);
        memset(user_grid[i], 0, sizeof(int) * col_size);
    }

    int **grid_copy = (int **) malloc(sizeof(int *) * (row_size));
    for (int i = 0; i < row_size; i++) {
        grid_copy[i] = (int *) malloc(sizeof(int) * col_size);
    }

    int **user_queue = (int **) malloc(sizeof(int *) * (row_size * col_size));
    for (int i = 0; i < (row_size * col_size); i++) {
        user_queue[i] = (int *) malloc(sizeof(int) * 2);
    }


    int lo = 0, hi = ESC_MAX, ans = ESC_MIN;

    escape_fire_loop(grid, row_size, col_size, fire_grid);
    escape_user_loop(grid, row_size, col_size, user_grid);


    if (fire_grid[row_size-1][col_size-1] == ESC_MAX && user_grid[row_size-1][col_size-1] != 0) {
        ans = ESC_MAX;
        goto release_and_response;
    } else if (user_grid[row_size-1][col_size-1] == 0) {
        ans = ESC_MIN;
        goto release_and_response;
    }

    
    hi = fire_grid[row_size-1][col_size-1];


    if ((fire_grid[row_size-1][col_size-1] - user_grid[row_size-1][col_size-1]) - 1 >= 0) {
        int fast_check = can_escape(grid_copy, row_size, col_size, (fire_grid[row_size-1][col_size-1] - user_grid[row_size-1][col_size-1])-1, fire_grid, user_grid, user_queue);
        if (fast_check != ESC_MIN) {
            ans = (fire_grid[row_size-1][col_size-1] - user_grid[row_size-1][col_size-1])-1;
            goto release_and_response;
        }
        fast_check = can_escape(grid_copy, row_size, col_size, (fire_grid[row_size-1][col_size-1] - user_grid[row_size-1][col_size-1]), fire_grid, user_grid, user_queue);
        if (fast_check != ESC_MIN) {
            ans = (fire_grid[row_size-1][col_size-1] - user_grid[row_size-1][col_size-1]);
            goto release_and_response;
        }
    }

    int last = 0;
    while (lo <= hi) {
        for (int i = 0; i < row_size; i++) {
            memcpy(grid_copy[i], grid[i], sizeof(int) * col_size);
        }
        int mid = (lo + hi) / 2;
        last = can_escape(grid_copy, row_size, col_size, mid, fire_grid, user_grid, user_queue);
        if (last != ESC_MIN) {
            ans = mid;
            lo = mid + 1;
        } else {
            hi = mid - 1;
        }
    }


    release_and_response:
    
        for (int i = 0; i < (row_size * col_size); i++) {

            free(user_queue[i]);

            if (i < row_size) {
                free(fire_grid[i]);
                free(user_grid[i]);
                free(grid_copy[i]);
            }
        }

        free(grid_copy);
        free(fire_grid);
        free(user_grid);
        free(user_queue);
    
    return ans;
}

